// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

/**
 * @title SupplyChain
 * @dev A smart contract to track items through a supply chain.
 */
contract SupplyChain {
    // A counter to ensure each item has a unique ID
    uint256 private s_itemCounter;

    // Enum to represent the different states an item can be in
    enum State { Created, InTransit, ArrivedAtRetailer, Sold }

    // Struct to hold all the information about a single item
    struct Item {
        uint256 id;
        string name;
        address currentOwner;
        State currentState;
    }

    // Struct to represent a single step in an item's history
    struct HistoryLog {
        uint256 timestamp;
        State state;
        address actor; // The address that performed the action
    }

    // Mapping from an item's ID to its details
    mapping(uint256 => Item) public items;
    // Mapping from an item's ID to its entire history log
    mapping(uint256 => HistoryLog[]) public itemHistory;
    // Mapping to store addresses of authorized participants (e.g., shippers, retailers)
    mapping(address => bool) public isParticipant;

    // The owner of the contract, who can add participants
    address public owner;

    // Events to notify the outside world (our web app) of important changes
    event ItemCreated(uint256 indexed itemId, string name, address indexed owner);
    event StateUpdated(uint256 indexed itemId, State newState, address indexed actor);

    // Modifier to restrict a function to be called only by the contract owner
    modifier onlyOwner() {
        require(msg.sender == owner, "Only the owner can call this function");
        _;
    }

    // Modifier to restrict a function to be called only by an authorized participant
    modifier onlyParticipant() {
        require(isParticipant[msg.sender], "You are not an authorized participant");
        _;
    }

    /**
     * @dev The constructor sets the contract creator as the owner.
     * The owner is also automatically a participant.
     */
    constructor() {
        owner = msg.sender;
        isParticipant[msg.sender] = true; // The creator is the first participant
        s_itemCounter = 0;
    }

    /**
     * @notice Adds a new address to the list of authorized participants.
     * @param _participant The address of the new participant.
     */
    function addParticipant(address _participant) public onlyOwner {
        require(_participant != address(0), "Invalid address");
        isParticipant[_participant] = true;
    }

    /**
     * @notice Creates a new item in the supply chain.
     * @param _name The name of the item (e.g., "Organic Coffee Batch #123").
     */
    function createItem(string memory _name) public onlyParticipant {
        uint256 itemId = s_itemCounter;
        items[itemId] = Item({
            id: itemId,
            name: _name,
            currentOwner: msg.sender,
            currentState: State.Created
        });

        // Add the first entry to its history
        _logHistory(itemId, State.Created);
        
        emit ItemCreated(itemId, _name, msg.sender);
        s_itemCounter++;
    }

    /**
     * @notice Updates the state of an existing item.
     * @param _itemId The ID of the item to update.
     * @param _newState The new state of the item.
     */
    function updateItemState(uint256 _itemId, State _newState) public onlyParticipant {
        require(items[_itemId].id == _itemId, "Item does not exist");
        require(items[_itemId].currentOwner == msg.sender, "You are not the current owner/handler of the item");

        items[_itemId].currentState = _newState;
        _logHistory(_itemId, _newState);

        emit StateUpdated(_itemId, _newState, msg.sender);
    }
    
    /**
     * @notice Transfers handling of the item to a new participant.
     * @param _itemId The ID of the item to transfer.
     * @param _newOwner The address of the new participant who will handle the item.
     */
    function transferItem(uint256 _itemId, address _newOwner) public onlyParticipant {
        require(items[_itemId].id == _itemId, "Item does not exist");
        require(items[_itemId].currentOwner == msg.sender, "You are not the current owner/handler");
        require(isParticipant[_newOwner], "The new owner must be an authorized participant");
        
        items[_itemId].currentOwner = _newOwner;
    }

    /**
     * @dev Internal function to log a history entry.
     */
    function _logHistory(uint256 _itemId, State _state) private {
        itemHistory[_itemId].push(HistoryLog({
            timestamp: block.timestamp,
            state: _state,
            actor: msg.sender
        }));
    }

    /**
     * @notice Fetches the entire history for a given item.
     * @return A list of all history logs for the item.
     */
    function getItemHistory(uint256 _itemId) public view returns (HistoryLog[] memory) {
        return itemHistory[_itemId];
    }
}

